import React from 'react';
const RecordButton = (onClick) => {

    const recordStyles = {
        height: "60px",
        width: "60px",
        backgroundColor: "#eb4f34",
        borderRadius: "50%",
    }


    return (
        <div style={recordStyles}></div>
    );
}

export default RecordButton
